import React from "react";
import "./Login.scss";
import { Link } from "react-router-dom";

const Login = () => {
  return (
    <div className="login">
      <div className="left">
        <span>Truy cập vào tài khoản của bạn</span>
        <form>
          <div>
            <input type="text" id="email" placeholder="Địa chỉ Email" />
          </div>
          <div>
            <input type="password" id="password" placeholder="Mật khẩu" />
          </div>
          <button type="submit">Login</button>
        </form>
      </div>
      <div className="right">
        <span>Cần một tài khoản?</span>
        <Link to='/client/src/pages/Login, Signup/Signup.jsx'><button>Đăng ký</button></Link>
      </div>
    </div>
  );
};

export default Login;
